import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import ImageShow from './components/ImageShow';

function App() {
  return (
    <div className="App">
    <Navbar/>
    <ImageShow bgImage={`url(${logo1})`}/>
    <Footer/>
    </div>
  );
}

export default App;
